// StatementLexerInit initializes any static state used to implement StatementLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewStatementLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func StatementLexerInit() {
	staticData := &StatementLexerLexerStaticData
	staticData.once.Do(statementlexerLexerInit)
}

// NewStatementLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewStatementLexer(input antlr.CharStream) *StatementLexer {
	StatementLexerInit()
	l := new(StatementLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &StatementLexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	l.channelNames = staticData.ChannelNames
	l.modeNames = staticData.ModeNames
	l.RuleNames = staticData.RuleNames
	l.LiteralNames = staticData.LiteralNames
	l.SymbolicNames = staticData.SymbolicNames
	l.GrammarFileName = "StatementLexer.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

